import CompanyBio from './CompanyBio'
import Home from './Home'
import { Route, Link } from 'react-router-dom'
import { Routes, route } from 'react-router-dom'


function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={Home} />
        <Route path="/bio" element={CompanyBio} />
      </Routes>      
    </>



  );
}

export default App;
